        /// <param name="left">ushort4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort.</param>
        /// <returns>ushort result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort shuffle(ushort4 left, ushort4 right, ShuffleComponent x)
        {
            return select_shuffle_component(left, right, x);
        }

        /// <summary>Returns the result of specified shuffling of the components from two ushort4 vectors into a ushort2 vector.</summary>
        /// <param name="left">ushort4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort2 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting ushort2 y component.</param>
        /// <returns>ushort2 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort2 shuffle(ushort4 left, ushort4 right, ShuffleComponent x, ShuffleComponent y)
        {
            return ushort2(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y));
        }

        /// <summary>Returns the result of specified shuffling of the components from two ushort4 vectors into a ushort3 vector.</summary>
        /// <param name="left">ushort4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort3 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting ushort3 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting ushort3 z component.</param>
        /// <returns>ushort3 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort3 shuffle(ushort4 left, ushort4 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z)
        {
            return ushort3(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z));
        }

        /// <summary>Returns the result of specified shuffling of the components from two ushort4 vectors into a ushort4 vector.</summary>
        /// <param name="left">ushort4 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort4 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort4 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting ushort4 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting ushort4 z component.</param>
        /// <param name="w">The ShuffleComponent to use when setting the resulting ushort4 w component.</param>
        /// <returns>ushort4 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort4 shuffle(ushort4 left, ushort4 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z, ShuffleComponent w)
        {
            return ushort4(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z),
                select_shuffle_component(left, right, w));
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static ushort select_shuffle_component(ushort4 a, ushort4 b, ShuffleComponent component)
        {
            switch(component)
            {
                case ShuffleComponent.LeftX:
                    return a.x;
                case ShuffleComponent.LeftY:
                    return a.y;
                case ShuffleComponent.LeftZ:
                    return a.z;
                case ShuffleComponent.LeftW:
                    return a.w;
                case ShuffleComponent.RightX:
                    return b.x;
                case ShuffleComponent.RightY:
                    return b.y;
                case ShuffleComponent.RightZ:
                    return b.z;
                case ShuffleComponent.RightW:
                    return b.w;
                default:
                    throw new System.ArgumentException("Invalid shuffle component: " + component);
            }
        }

    }
}

